import React from "react";
import logo from "../assets/logo/Logo-brainflix.svg";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img src={logo} alt="this is the Brainflix logo" />
        This is my navbar
      </div>
    );
  }
}

export default Navbar;
